from math import sqrt

def count_ordered_pairs(d, p):
    if d <= 0:
        return 0
    ret = set()
    D1 = d * d + 4 * p
    if D1 >= 0:
        a = round((d - sqrt(D1)) / 2)
        if a * (d - a) == -p:
            ret.add((a, d - a))
        a = round((d + sqrt(D1)) / 2)
        if a * (d - a) == -p:
            ret.add((a, d - a))
        a = round((-d - sqrt(D1)) / 2)
        if a * (-d - a) == -p:
            ret.add((a, -d - a))
        a = round((-d + sqrt(D1)) / 2)
        if a * (-d - a) == -p:
            ret.add((a, -d - a))
    return len(ret)

